  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0089636 includes physical
  and underway data collected aboard the ROGER REVELLE during cruise RR1006 in the
  Philippine Sea from 2010-05-08 to 2010-05-26. These data include CURRENT SPEED -
  EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments
  used to collect these data include ADCP and GPS. These data were collected by James
  Mercer of UNIVERSITY OF WASHINGTON and SCRIPPS INSTITUTION OF OCEANOGRAPHY as part
  of Philippine Sea Integrated Experiment. The Lamont-Doherty Earth Observatory (LDEO)
  submitted these data to NODC as part of the NSF sponsored Rolling Deck to Repository
  (R2R) program. The ADCP data represent the raw and automated processed data set.
  Post processed quality assessed data are not available in this accession.\",\n\t\"owner_org\":
